    }

    private org.jsoup.parser.Document parse() {
        while (!tq.isEmpty()) {
            if (tq.matches("<!--")) {
                parseComment();
            } else if (tq.matches("<![CDATA[")) {
                parseCdata();
            } else if (tq.matches("<?") || tq.matches("<!")) {
                parseXmlDecl();
            } else if (tq.matches("</")) {
                parseEndTag();
            } else if (tq.matches("<")) {
                parseStartTag();
            } else {
                parseTextNode();
            }
        } 
        return doc.normalise();
    }

    private void parseComment() {
        tq.consume("<!--");
        java.lang.String data = tq.chompTo("->");
        if (data.endsWith("-")) {
