        java.lang.Character firstChar = tq.consume();
        boolean procInstr = firstChar.toString().equals("!");
        java.lang.String data = tq.chompTo(">");
        org.jsoup.parser.XmlDeclaration decl = new org.jsoup.parser.XmlDeclaration(data, baseUri, procInstr);
        last().appendChild(decl);
    }

    private void parseEndTag() {
        tq.consume("</");
        java.lang.String tagName = tq.consumeWord();
        tq.chompTo(">");
        if (tagName.length() != 0) {
            org.jsoup.parser.Tag tag = org.jsoup.parser.Tag.valueOf(tagName);
            popStackToClose(tag);
        }
    }

    private void parseStartTag() {
        tq.consume("<");
        java.lang.String tagName = tq.consumeWord();
        if (tagName.length() == 0) {
