        }
    }

    private void parseTextNode() {
        java.lang.String text = tq.consumeTo("<");
        org.jsoup.parser.TextNode textNode = org.jsoup.parser.TextNode.createFromEncoded(text, baseUri);
        last().appendChild(textNode);
    }

    private void parseCdata() {
