        boolean validAncestor = stackHasValidParent(childTag);
        if ((!validAncestor) && (!relaxed)) {
            org.jsoup.parser.Tag parentTag = childTag.getImplicitParent();
            org.jsoup.parser.Element implicit = new org.jsoup.parser.Element(parentTag, baseUri);
            if (child.tag().equals(org.jsoup.parser.Parser.bodyTag)) {
                org.jsoup.parser.Element head = new org.jsoup.parser.Element(org.jsoup.parser.Parser.headTag, baseUri);
                implicit.appendChild(head);
            }
            implicit.appendChild(child);
            org.jsoup.parser.Element root = addChildToParent(implicit, false);
            if (!isEmptyElement) {
                stack.addLast(child);
            }
            return root;
        }
        parent.appendChild(child);
        if (!isEmptyElement) {
            stack.addLast(child);
        }
        return parent;
    }

    private boolean stackHasValidParent(org.jsoup.parser.Tag childTag) {
        if ((stack.size() == 1) && childTag.equals(org.jsoup.parser.Parser.htmlTag)) {
            return true;
        }
        if (childTag.requiresSpecificParent()) {
            return stack.getLast().tag().isValidParent(childTag);
        }
        for (int i = stack.size() - 1; i >= 0; i--) {
            org.jsoup.parser.Element el = stack.get(i);
            org.jsoup.parser.Tag parent2 = el.tag();
            if (parent2.isValidAncestor(childTag)) {
                return true;
            }
        }
        return false;
    }

    private org.jsoup.parser.Element popStackToSuitableContainer(org.jsoup.parser.Tag tag) {
        while (!stack.isEmpty()) {
            if (last().tag().canContain(tag)) {
                return last();
            } else {
                stack.removeLast();
            }
        } 
        return null;
    }

    private org.jsoup.parser.Element popStackToClose(org.jsoup.parser.Tag tag) {
        int counter = 0;
        org.jsoup.parser.Element elToClose = null;
        for (int i = stack.size() - 1; i > 0; i--) {
            counter++;
            org.jsoup.parser.Element el = stack.get(i);
            org.jsoup.parser.Tag elTag = el.tag();
            if (elTag.equals(org.jsoup.parser.Parser.bodyTag) || elTag.equals(org.jsoup.parser.Parser.htmlTag)) {
                break;
            } else if (elTag.equals(tag)) {
                elToClose = el;
                break;
            }
        }
        if (elToClose != null) {
            for (int i = 0; i < counter; i++) {
                stack.removeLast();
            }
        }
        return elToClose;
    }

    private org.jsoup.parser.Element last() {
        return stack.getLast();
    }
}

